import CountUp from 'react-countup/'
const Dashboard = () => {

    const cards =  [
        { Title: 'No of Registered Users', counter: 1033,},
        { Title: 'No of Vouchers Sold', counter: 7450,},
        { Title: 'No of agents onboard', counter: 56,},
    ]

    return ( <div className="dashboard flex px-4 py-8 bg-gray-500">
        {cards.map((card, index)=>(
            <div className="container flex">
                <i className='fas fa-users mr-10'></i>
                <div>
                <p className='text-center'><CountUp start={0} end={card?.counter} duration={5} delay={1} /></p>
                <p>{card.Title}</p>
                </div>


            </div>
        ))}
    </div> );
}

export default Dashboard;
